import React from 'react';

const Card = (props) => {
    return (
        <div className="card bg-dark text-white">
            <img className="card-img" src={props.imageSrc} alt="Card image" />
            <div className="card-img-overlay card-content">
                <h5 className="card-title">{props.title}</h5>
                <p className="card-text">{props.percentageOff}</p>
                <button className="card-text">{props.buttonText}</button>
            </div>
        </div>
    );
}

export default Card;
